descr:
VUE EXCEPTIONNELLE SUR LA Tour Eiffel ET LE PALAIS DE CHAILLOT;
Dans immeuble pierre de taille, au dernier étage par escalier secondaire, GRAND studio avec coin cuisine, salle de Douche avec WC, placards.
